window.bookSummaryJSON = "<p><b>Ashira is now in the know of Jas' complicated world—or is she?</b></p> <p>The \"construction laborer\" is really a wealthy felon with too many inexplicable circumstances to fathom for her narrow worldview. Will Jas share more of his complexities? Will Ashira be able to absorb them with understanding, leaving the judgment behind?</p> <p>Two souls, still galaxies apart, bound by love.</p> <p>The unanticipated UFO has collided with her world like a ferocious asteroid. Find out if their unmitigated passion for each other is enough to flourish in <i>Grace</i>.</p> <p><i>Grace</i> is book two in the Prism trilogy and ends on a cliffhanger. Intended for mature listeners.</p>"; 
